import React from "react";
import rates from "./rates";

const currenciesList = Object.keys(rates);

const CurrencyMenu = () => {
  return (
    <>
      {currenciesList.map((el) => {
        return <option value={el}>{el}</option>;
      })}
    </>
  );
};
